import React from 'react';
import './ImageLinkForm.css';

const ImageLinkForm = () => {
    return (
        <React.Fragment>
            <p className='f2 b'>
                {'Spot faces in your images. Give it a try!'}
            </p>
            <div className='center'>
                <div className='center image-form pa4 br3 shadow-5'>
                    <input className='f4 pa2 w-70 center' type="text" placeholder="Enter image url..."/>
                    <input className='w-30 grow f4 link ph3 pv2 dib white bg-light-purple' type="submit" value="detect" />
                </div>
            </div>
        </React.Fragment>
    );
};

export default ImageLinkForm;
